import { DateRangePicker } from 'rsuite';
export const instance = () => {
  return (
    <div>
      <DateRangePicker
        appearance="default"
        placeholder="Default"
        style={{ width: 280 }}
      />
      <hr />
      <DateRangePicker
        appearance="subtle"
        placeholder="Subtle"
        style={{ width: 280 }}
      />
    </div>
  )
};
